void SysTick_Handler(void){
		reddiXposinit= reddiXpos;
		reddiXpos = ADC_In0();
		reddiXpos = (reddiXpos)/30;
		valvanoXposinit= valvanoXpos;
		valvanoXpos = ADC_In1();
		valvanoXpos = ((valvanoXpos)/30)+30;
		
		
		if (reddifire){
			if (paper[j].alive ==0){
				reddifire=0;
				paper[j].alive=1;      //reddis bullet starts
				paper[j].xpos=reddiXpos;
				paper[j].ypos=25;
				paper[j].yposinit=25;
				paper[j].direction=0;				//direction 0 is reddi firing
				
				if (j>bulmax){
					j=0;
				}
				else{
					j++;
				}
			}	
		}
		
		if (enemyfire){
			if (paper[j].alive == 0){
				enemyfire=0;
				paper[j].alive=1;      //reddis bullet starts
				paper[j].xpos=valvanoXpos;
				paper[j].ypos=30;
				paper[j].yposinit=30;
				paper[j].direction=1;				//direction 1 is enemy firing
				if (j>bulmax){
					j=0;
				}
				else{
					j++;
				} 
			}
		}
		
		for (int i=0; i<bulmax; i++){													//occurs in the systic handler triggered at 30 Hz
			if (paper[i].alive ==1){
				if ((paper[i].ypos < 1)||(paper[i].ypos>129)){			//end bullet existence
					paper[i].alive=0;
				}
				else{
					if (paper[i].direction ==0){
						paper[i].yposinit=paper[i].ypos;							// set previous state y position for drawing black box over trail
						paper[i].ypos +=3;
					}
					else {
						paper[i].yposinit=paper[i].ypos;
						paper[i].ypos +=3;
					}
				}
			}
			
		}
		if (moneyflag){
			if (money[0].alive ==0){
				moneyflag=0;
				money[0].alive=1;	
				money[0].xpos=reddiXpos;
			}
		}
		
		if(money[0].alive==1){
				if (money[0].ypos>129){
						money[0].alive=0;
					}
					else {
						money[0].yposinit=money[0].ypos;
						money[0].ypos +=1;
						
					}
			}
		
		
		mainflag = 1;
	}
	

